■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>お米の保存に適した桐材を使用。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5109/0225bh-01.jpg" width="600" height="399"><br><font size=3>※お届けは「20kg用」になります。</font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">桐材は繊維密度が高く材料内部に気泡が多い事から、湿度や温度の変化に影響を受けにくくお米の保存に適しています。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="399" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5109/0225bh-02.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="399" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5109/0225bh-03.jpg"><br><font size="3"></font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="399" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5109/0225bh-04.jpg"><br><font size="3">イメージ画像※小物はついておりません。</font></div><br></td></tr><tr><td width="600" valign="top"><div align="center"><img width="600" height="487" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5109/0225bh-05.jpg"><br><font size="3">使用イメージ※お米はついておりません。</font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">米どころ＆桐タンスの街、新潟県加茂市で生まれた桐の米びつ。桐が湿気を調整してお米を美味しく保存します。桐タンスと同じ製法で一つ一つ手作りです。桐の特性を熟知した匠の技が注ぎ込まれています。桐に浸透させて呼吸を妨げないオリジナル塗装を施し、汚れがつきにくく水拭きもできて便利です。</font></td></tr></table><br><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">米どころ＆桐タンスの街、新潟県加茂市で生まれた桐の米びつ。桐が湿気を調整してお米を美味しく保存します。桐タンスと同じ製法で一つ一つ手作りです。桐の特性を熟知した匠の技が注ぎ込まれています。桐に浸透させて呼吸を妨げないオリジナル塗装を施し、汚れがつきにくく水拭きもできて便利です。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">22.5×40×45cm</font><br><font color="#333333" size="-1">個装サイズ：24×41×46cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">3.3kg</font><br><font color="#333333" size="-1">個装重量：4100g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">桐</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">容量:20kg<br>完成品</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">1合マス</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
